__NUXT_JSONP__("/adopt/elsa", (function(a,b,c,d,e,f){return {data:[{chihuahua:f,chihuahuaSE:f,chihuahuaMW:{_createdAt:"2021-05-09T21:01:24Z",_id:"4766fc37-517d-477e-8bd3-6c14751f2dd6",_rev:"yXwlT3WstaCz55q6hnrlcq",_type:"chihuahuasMW",_updatedAt:"2021-05-09T23:56:55Z",age:"6 years old",chihuahua:"Elsa",description:[{_key:"f61c52287481",_type:a,children:[{_key:"838606197e3c",_type:b,marks:[],text:"Have you been feeling frozen lately? I have just the thing to warm you up! I’m Elsa, a nine-pound, six-year-old female chihuahua, fully vetted, spayed, vaccinated, microchipped, and on heartworm medication. My brother, Elvis, and I are ready to bring double the cuddles, guaranteed to melt the coldest of hearts!"}],markDefs:[],style:c},{_key:"2fb9dd19954e",_type:a,children:[{_key:"bbc6a406f4b20",_type:b,marks:[],text:"You’ll love my snow-white, long fur, with a sassy brown spot over one big brown eye! It brings me lots of positive attention, and when it comes to attention, I just can’t get enough! I am hoping for a forever family who will treat me like the princess I am (my brother, of course, is the King) and lavish me with snuggles and belly rubs."}],markDefs:[],style:c},{_key:"cc105c4cfc51",_type:a,children:[{_key:"41d45d5553410",_type:b,marks:[],text:"My brother and I are very close, so we’ll need to be adopted together. Worried about adopting two dogs? Let it go! We’re both so small that our combined weight is less than one average dog, yet you’ll get the added fun of watching us play and interact together!"}],markDefs:[],style:c},{_key:"90b2327ebd67",_type:a,children:[{_key:"09b8102fb5400",_type:b,marks:[],text:"Can’t hold back anymore? Great! Fill out an application! You’ll soon learn that some pups are worth melting for!"}],markDefs:[],style:c},{_key:"20021acb23d7",_type:a,children:[{_key:"818772d74b400",_type:b,marks:[],text:"Elvis and Elsa’s adoption fees are $300 each. If you are interested in adopting Elvis and Elsa, please DO NOT SEND A MESSAGE TO OUR RESCUE GROUP. We are too busy placing dogs in great homes to answer messages and inquiries through the listing site."}],markDefs:[],style:c},{_key:"47e297b7381c",_type:a,children:[{_key:"8aeb6b8493850",_type:b,marks:[],text:"PLEASE GO TO THE LINK BELOW TO COMPLETE AN ADOPTION APPLICATION."}],markDefs:[],style:c},{_key:"fca3da62c364",_type:a,children:[{_key:"347f96d5d7820",_type:b,marks:[],text:"CRT requires an approved adoption application and a home visit for all adoption applicants. CRT transports to OH, KY, IL, MI, MN, WI."}],markDefs:[],style:c}],gender:"female",imageThree:{_type:d,asset:{_ref:"image-5bd5751ccf29401c3608e4e743571135b7571552-768x768-jpg",_type:e}},imageTwo:{_type:d,asset:{_ref:"image-afe00a02b4c6e4af555ce165fae90173351c4261-768x768-jpg",_type:e}},mainImage:{_type:d,asset:{_ref:"image-41f7e4ae6d78e6a2fc24194cb0285c299ce1e9bc-250x250-jpg",_type:e}},neuteredSpayed:"Yes",order:1,region:"midwest",slug:{_type:"slug",current:"elsa"},status:"Available",tagline:"My brother, Elvis, and I are ready to bring double the cuddles",weight:"9 pounds"}}],fetch:[],mutations:[]}}("block","span","normal","image","reference",null)));